import Header from "./Header";
import { FoodContextPovider } from "../../Storage/FoodContext";
import Foods from "./Foods";

const MainPage = (props) => {
  return (
    <div>
      <Header />
      <FoodContextPovider>
        <Foods />
      </FoodContextPovider>
    </div>
  );
};

export default MainPage;
